import React, { useEffect, useState } from 'react'

function App() {
  const[posts, setPosts] = useState([{}]);

  useEffect(() => {
    fetch('/posts').then(
      response => response.json()
    ).then(
      data => {
        setPosts(data);
      }
    )
  }, []);

  return (
    <>
      {(typeof posts === 'undefined') ? (
        <p>loading posts...</p>
      ) : (
        posts.message.map((text, i) => (
          <p key={i}>{text}</p>
        ))
      )}
    </>
  )
}

export default App
